const TablaProductos = (props) =>{
    const productos = props
    
    return(
        <table>
            <thead>
                <tr>
                    <th>Nombre</th>
                    <th>Precio</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <th>Sporting Goods</th>
                </tr>
                {props.productos.map((prodcuto) =>(
                    <tr>
                        {!prodcuto.stocked  && prodcuto.category === 'Sporting Goods'? (
                            <td><span style={{color: 'red'}}>{prodcuto.name}</span></td>
                        ) : (
                            <td>lol</td>
                        )}
                        <td>{prodcuto.price}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    )
}

export default TablaProductos;
